import axios from 'axios';




export default function VideoList()
{
    useEffect(async()=>{
            await axios({
            method:'get',
            url:'/videoFs/getVideos',
            })
        .then(res=>res.data)
        .catch(err=>console.log(err))
        .then(res=>{
            console.log(res);
        })

    },[])


    return<div>

    </div>
}
